2	20	85	Inside Omnis Notation (updated for 2015)	This session is for those who want to know the difference between built-in and custom notation, how to squeeze extra performance out of methods, what notation you can use in JS Client, or simply understand the structure, intricacies, pitfalls and benefits of notation.	'Omnis Notation' (originally designed and developed by David Seaman) was the dawn of a new age in the Omnis programming world. It provided a language capable of describing the Omnis environment (design and runtime) in minute detail. It’s structured approach to Omnis properties, methods and groups paved the way to new advances such as IDE tools written as Omnis libraries and the new Studio external SDK.\r\rUsing a holistic approach, this session aims to explain what notation is, how it works, and how the use of notation differs or is similar within JS Client-, Omnis Server- and Fat-Client programming. The session is divided into two parts. The first part is concerned with notation basics such as the overall concept and different types of notation. In the second part we will cover some of the more specialised notation relevant to JS Client, Omnis Server programming and Fat-Client programming. There may not be time to cover all of the specialised notation and although there will be a focus on differences and similarities between JS Client, Omnis Server and Fat-Client notation, we may also look at other notation of special interest, such as reporting.\r\rYou will learn about:-\r-\tnotation as a hierarchical description of the Omnis environment \r-\tthe difference between build-in and custom notation, properties and methods, instance and class notation. \r-\tthe power of notation in manipulating window/remote forms and their objects.\r-\tthe benefits and relevance of notation in inheritance.\r-\tdifferent performance tricks that can be utilised within sever-client and fat-client models.\rOptional modules:-\r-\tJava Script Client (server/client module overview and detailed look at special client and server notation)\r-\tSpecial Interest Notation (object variable, complex grid, list notation, report notation	\N	\N	\N	mostynrs	2015-07-22 16:48:55	mostynrs	2015-07-22 17:10:32	0
3	20	85	External component development (updated for 2015)	If you want to know how to write Javascript or window controls, how to inject special data into Omnis reports, how to turn report data into what you need, or simply how to add your own functions and constants to the catalogue, this session is for you.	No other RAD development tool provides an external plug-in SDK that is so comprehensive and integrated as that of Omnis Studio. With the Omnis external SDK you can build C++ libraries that contain: controls for editing and inputting data for use in desktop and web forms; non-visual external objects that can be inherited by Omnis 4GL object classes; static functions and constants that can be used anywhere in an Omnis application; report objects for printing special data; external devices for converting output from printing to whatever format is required; and data access modules (DAMs) that bring together any database backend with Omnis as the application front end.\r\rTo begin with, this session will introduce the basic external component architecture and methodology. This will be followed by a look at some specific examples of external components such as how to develop JS Client components with and without using c++.  If there is time left and you have XCode (6.3.x recommended) or Visual Studio (2013 recommended) installed on your laptop Michael will help you with compiling and debugging an Omnis component. As external component development is a vast subject (there are many types of different components that can be created) we will concentrate on specific areas that interest the group, hopefully making this session more interactive and more interesting and current. The aim is that by the end of this session you have gained sufficient inside into Omnis component development to encourage you to have a go.\r\rYou will learn about:-\r-\tomnis SDK modules such as the Javascript, HWND, GDI and PRI SDKs.\r-  what it takes to move your components to 64 bit and Cocoa\r-\timplementing component properties, methods and Omnis events.\rOptional modules:-\r-\timplement JS client controls using only HTML and Javascript.\r-\tproviding a design interface for your JS client controls using c++.\r-\thandle paint, mouse, keyboard and scrolling events for fat-client window controls.\r-\twriting a printing device to convert report output.\r-\twriting a report object for generating report output.\r-\tcreate non-visual objects that can be inherited by the Omnis 4GL object class.	\N	\N	\N	mostynrs	2015-07-22 16:49:59	mostynrs	2015-08-24 12:15:47	0
7	20	\N	Database modeling and database "reorganisation" in SQL	When looking at native datafiles one advantage of using them was that\rOmnis would automatically push file class changes to the datafile. Also\rwith the move to schema classes we've lost some important meta data. In\rthis session we'll look at an approach to do this in SQL.	This session concentrates on what I believe is one of the key missing\rpuzzle pieces in Omnis when dealing with SQL database. While many of us\rpiggy back on existing databases or use external applications to model\rdata models and create scripts to apply changes to their database not\rbeing able to use your library as a leading source and pushing out\rchanges to your database during an upgrade.\r\rWe'll first look at adding meta data to our schema classes to complete\rthe missing information such as indexes, referential integrity,\rconstraints, etc.\rThen we'll look at how to reverse engineer this information out of a\rdatabase mostly focussing on how to do so in Postgres.\rFinally we'll look at how we can use this information to make a\rcomparison with our schema classes to either pull new table changes out\rof your database into your application and how to push changes you've\rmade in your library to your database.\r\rWe'll also look at a few pitfalls and do's and don'ts and have a\rdiscussion on how the added meta data can be used to speed up\rdevelopment of your application as well as it is now aware of how tables\rare joined.\r\rIf we have have time enough we'll also have a look at views, types,\rstored functions and triggers.	\N	\N	\N	mostynrs	2015-07-26 11:46:12	mostynrs	2015-07-26 11:46:12	0
