14	20	\N	Getting a handle on Events and Tasks	In this session we will explore techniques for handling events and working with tasks in your Omnis Studio applications.	At its most basic level, event-handling in Omnis Studio is quite simple. But sooner or later most developers encounter challenges working with more complicated GUI controls, or handling events in nested containers. Using an interactive workshop format, we’ll explore several approaches to working with:\r\r* $event and $control methods\r* Working with the event chain\r* Drag-and-drop\r* Grids and lists\r* Trees and tabs\r* Context menus\r\rWe will also explore tasks in detail, answering your questions about:\r* current and active tasks\r* using multiple tasks\r* tasks and variable scope\r* managing context switches	\N	\N	\N	mostynrs	2015-07-29 07:25:50	mostynrs	2015-10-02 07:37:03	0
17	20	\N	Menu System, Messaging and Access Rights in a Omnis JavaScri	Many Omnis developers wonder how to implement a menu system into an Omnis JavaScript application and also control user or role based access rights. There is also a demand to have a popup remote form that allows the user to prompt for information while the main application is in the back ground.	Using an example of a forum like software we are going to learn how a dynamic menu system can be implemented using a folder structure inside the library and reused easily in other projects. It also shows a way how to implement a messaging system between the forms and how an abstract messaging interface can be implemented using super classes. There will also be an example how to use the subformset instance dynamically in order to prompt the user just like a popup window but within the JS application.	\N	\N	\N	mostynrs	2015-07-29 10:56:27	mostynrs	2015-07-29 10:56:27	0
18	20	\N	Application Updating Round Table	Distributing updates to an application is becoming a hot topic as people seek to implement updates over the internet, not just the LAN.  The latest issues will be discussed here, along with an exploration of possible solutions.	Windows has implemented a "sandbox" environment for some time, helping to make the OS safer from hackers.  Apple are gradually implementing a similar policy.\r\rIn this discussion, a world cafe on the topic of distributed application updates, the intricacies of this topic will be discussed, current strategies shared and hopefully a clearer approach will be worked out.	\N	\N	\N	mostynrs	2015-07-31 12:08:31	mostynrs	2015-07-31 12:08:31	0
20	20	\N	Omnis Synchronization Facility	Omnis Synchronization Facility - What can it do for you.	As of Omnis 6 a synchronization tool was provided which allowed for the ability to support the concept of distributed data. This session will take the attendee through where to find this feature in Omnis Studio, its architecture and how to setup the synchronization process. After that mundane stuff is done we will go into the various data distribution models that the tool can support. Some of the ares that will be addressed are mobile apps, multi-site data sharing, master-slave  and a number of other data distribution techniques. This tool helps solve some major issues when trying to share data across different physical locations which are not connected to a central server continuously. Bring your question and thinking caps.	\N	\N	\N	mostynrs	2015-08-02 18:16:24	mostynrs	2015-08-02 18:16:24	0
19	20	\N	Software Development Methodologies	The Conundrum of What Methodology to Use	With the constantly changing landscape of tools, platforms and skill sets, plus the demand to deliver solutions faster, an approach to deal with these challenges is needed. This session will expose the attendees to a number different methodologies which are in use today. Besides presenting the information about different techniques the session will also present the formalized iterative methodology of Agile in a real world use case. Bring your questions and thoughts to the session, as always the session is to be interactive.\r	\N	\N	\N	mostynrs	2015-08-02 18:15:18	mostynrs	2015-08-02 18:17:20	0
13	20	\N	Reports from the Front	We will explore several different approaches to designing and printing reports in Omnis Studio.	Omnis Studio provides developers with powerful reporting capabilities. In this session we’ll explore several approaches to building reports, learning to work with the flow of the Omnis report process:\r\r* Printing reports via 4GL commands and notation\r* Creating adaptable reports with the Report Data Grid component\r* Using $print methods in report sections and report fields\r* Managing print destinations\r* Archiving report images\r* Super classes with reports	\N	\N	\N	mostynrs	2015-07-29 07:25:20	mostynrs	2015-10-02 07:38:09	0
22	20	\N	Data speed optimization for the Javascript Client and Server	We will explore techniques for data speed optimization of the JavaScript Web Client and for the Omnis Server. Hands on with a sample library we will cover multilevel caching, ER Model adoptions on server and client, background operations and multithreaded data operations. 	In this session, we will explore techniques for data speed optimization of the JavaScript Web Client and for the Omnis Server. Using a sample library that will be available to attendees, we will work on how to cache data on multiple levels, how to adopt ER Models on server and client, how to implement background operations and what changes are needed to control and benefit from multithreaded data operations. \r\r•\tMultilevel caching \ro\tCRB on client\ro\tpersistent sessions - without persistent tasks\ro\tlocal database on client – without wrapper\r•\tER Model Adaption\ro\tClient\ro\tServer \r•\tBackground operations talking to\ro\tOmnis Server\ro\tOther Servers\ro\tPeer Computers\r•\tMultithreaded data operations\ro\tClient\ro\t(Server)	\N	\N	\N	mostynrs	2015-08-02 18:21:45	mostynrs	2015-08-02 18:21:45	0
