32	20	\N	Subwindow widgets	Subwindows are very powerful objects. They are even more powerful than Tiger Logic would tell you in the manuals. With some inside knowledge, you can turn them into fully working widgets.  This means the handling simplicity of an entry field, combined with unlimited encapsulated complexity and functionality.	Subwindows are very powerful objects. And you might have used subwindows already for years without being aware of their hidden strengths. Ever wondered what the $dataname property is good for? This is what the manual says: ‘normally you should leave the $dataname property empty‘. And in fact, you can do useful things without the $dataname property. However, imagine you could assign a variable to a subwindow’s $dataname, as you do with entry fields. Imagine, the subwindow could not only read this variable, but also change it and hand it back to your main window variable, and this all ‘out of the box’ – without further coding in your main window.\r \rWe will investigate the utilization of the $dataname property in this lecture, and look behind the scenes how subwindows really work. We will learn how to transmit data into the subwindow just by assigning a variable to $dataname, reading and modifying its contents in the subwindow, and send it back to the main window variable, step by step and with useful examples. In the end, you will be able to create your own widgets in Studio – your own fully portable and reusable window elements, designed for your very own needs in your applications.  Did you ever miss a specific window element in Studio? Now go and create it on your own.\r \rThis session is for beginners and advanced Studio developers, and hopefully will leave you with tons of new ideas.	\N	\N	\N	mostynrs	2015-08-11 09:43:18	mostynrs	2015-08-11 09:43:18	0
33	20	\N	The DataUniverse	With just a few basic and easy-to-implement concepts we can leave the traditional file- or table based data organization behind, and enter the fantastic world of the DataUniverse. Symmetric links on record base will give us a point-of-view data representation, while inheritance of file/schema definitions allow us to organize the data itself hierarchically with inheritable data attributes.	In 2002 at OzOmnis, I introduced a – at that time totally different – concept for organizing data. It was no more than just an idea, and only intended as a small side step in my lecture about the Omnis datafiles. Amazingly, the audience was very keen about the introduction and a lot of questions were asked. Now, after more than one decade, the DataUniverse has developed from a concept to a fully working SQL-based implementation, that is used in my application.\r \rIn this lecture, we first will go through the requisites, that allow us to literally organize the world. The DataUniverse in fact is a cosmos of data, with individual links between its elements, that are not relational but symmetric. The implications are huge:  You now can navigate and interpret your data set from any individual element’s perspective, giving you a dynamic point of view representation of your whole database. We will find out that it does not take much to implement a DataUniverse into existing frameworks with only a few generic elements.\r \rIn a second step, we learn how to technically implement inheritance of schema classes, so that for example a person table is inherited in a client table at one place, and a patient table at another place, without the need of duplicating the person data. In principle, we can nest data definitions  to every level we want, allowing us to implement data hierarchies within our database, and – most important – simply by using Studio’s own inheritance features and some code lines in the superclass of the table definitions.\r \rA running gag in the Omnis community says, that every developer has his own framework. This lecture wants to enable you to partially or fully implement the DataUniverse into your own individual framework without the need of reinventing the wheel, but also without breaking your own development. All features can be expressed in your own terms and SQL implementations other than demonstrated. The session introduces a terrific way of organizing data, and how I implemented it; it is by default open for brainstorming, additional features and different implementation strategies and hopefully will give you a brand new view to data organization.\r \rThis session needs a little experience in SQL and in the object oriented paradigm of Omnis Studio.	\N	\N	\N	mostynrs	2015-08-11 09:47:22	mostynrs	2015-08-11 09:47:22	0
