15	20	\N	Table Magic	The Power and Elegance of the Omnis Table Class	One of the hidden treasures of Omnis Studio. Frequently overlooked but the source of so much productivity.\r\rThe database is the skeleton upon which every business application works. Accessing that database and manipulating its contents is the most fundamental interaction between the user and the source (i.e. the data), facilitated by Omnis and you, the developer.\r\r•     The table class offers an incredible amount of power in terms of :\r•     Standard SQL calls\r     •     Enhancing your data access utilising SQL joins within a query very powerfully\r     •     Accessing stored procedures\rAs a non-visual object and one that lends itself very effectively to OO principles such as inheritance and polymorphism, the table class is one of the most potent “starting points” in contemplating both a DML to SQL or Omnis 7 to Studio conversion. It offers the most fertile environment to introduce newcomers to the object oriented paradigm and “change the way you think” about programming.\r\rIn this presentation the table class is explored using an evolutionary process, building up from the standard SQL access Omnis offers and seeing how the table class can enhance the developer experience and productivity in several ways.\r\r     •     Roll your own, reusable SQL\r     •     Simplifying your data access code\r     •     Exploiting OO principles\r     •     Automating standard logging columns\r     •     Simplifying multiple database access within a single application\r     •     Accessing encrypted data\rIf you are not already using table classes, or if you suspect you are only scratching the surface, this presentation is for you!	\N	\N	\N	mostynrs	2015-07-29 10:19:11	mostynrs	2015-08-20 10:39:20	0
