46	20	\N	A new way of looking at your data	Find out how to provide powerful interfaces for ad-hoc reports, projects, booking systems and schedules, and learn how the latest Brainy Data JavaScript controls have transferred this power to web-client development.\r	This commercial session will present tools with which users can create sophisticated documents for data merging, manage appointments and large projects, produce PDF/A documents for long-term archiving, create rich HTML mail-shots, create user customised invoices and much more.\r\rThe presentation focuses on Brainy Data’s five main products, OWrite, PDFDevice, OSpell2, OGantt and OCal. OWrite looks and behaves like a word processor allowing end-users to feel right at home, but was specifically designed with Omnis data in mind. Its specialised features coupled with its word-processing capabilities make OWrite an indispensable tool, providing end users with an easy-to-use powerful interface for managing the appearance of their documents, and providing developers with the programmability to truly control every aspect of ad-hoc reporting and related automated processes. PDFDevice has been highly optimised for speed and is preferred by many Omnis developers as  the tool for producing PDF files from Omnis. It is ideally suited for converting OWrite documents into professional looking PDF documents complete with document outline tress based on OWrite heading styles. OSpell2 is the only way to add check-as-you-type spellchecking to your Omnis application. For those interested in appointment scheduling, project management or booking systems, the OGantt and OCal presentation will show how easy it is to add a graphical interactive interface to your application that is not just intuitive but also very fast. All desktop client tools are written in c++ for ultimate performance.\r\rIf you have not yet explored the Omnis Studio JS-Client, perhaps now is the time. With the arrival of JS-OWrite there is one less stumbling-block to providing rich and powerful interfaces on javascript capable devices. For Brainy Data, the Javascript client is an on-going long-term project and we aim to port all our interface tools to this new platform. We have already developed and released JS-Signature for mobile document signing and are currently nearing the end of a very long road, namely porting OWrite to JS-Client. We are hoping JS-Owrite will be in final beta release prior to the EurOmnis conference. The JS-OWrite presentation will showcase the creating, editing and data-merging of rich documents from within a Javascript enabled browser.	\N	\N	\N	mostynrs	2016-03-31 17:25:00	mostynrs	2016-07-21 13:31:58	0
