68	20	\N	SQL That Works For You	A look at powerful SQL commands that do a lot of work for you: Merge, Analytic functions, Common Table Expressions, Group By Rollup/Grouping Sets, and more.	We've all had to do it. Bring lots of data back to Omnis to process or summarize before presenting on screen or printing. Or execute many calls  to the database to figure out if records exist already before revising or inserting data. This session will look at powerful SQL commands that can do a lot of work for you in a single SQL call, avoiding many of those extra round trips.\r\rWe will look at the MERGE command to insert or update records based on what's already in the database; at various Analytic functions that do ranking, percentages and row numbering based on what's in the result set; at Common Table Expressions for making your sql calls more efficient; and at Group By Rollup and Grouping Sets to generate multi-level subtotals for reporting without depending on the Studio reporting tools.\r\rAs time permits we will look at other SQL functions that can be handy in your application. This session will focus on the SQL side of things. It will not cover how to connect Studio to a database or use Studio SQL classes. How you ultimately use these SQL techniques in your application will be up to you.	\N	\N	\N	mostynrs	2017-03-15 08:03:16	mostynrs	2017-07-26 12:04:34	0
