complete with document outline trees based on OWrite document styles, but can equally produce sophisticated outlined PDF documents from any Omnis report. OSpell2 can provide application wide check-as-you-type spellchecking and for those interested in appointment scheduling, project management or booking systems, the OGantt and OCal presentation will show how to add a graphical interactive interface to your application that are intuitive and fast. All desktop client and Omnis server tools are written in c++ for ultimate performance.\r\rJavascript ports:\rThe Javascript client ports are on-going long-term projects for Brainy Data. These ports are particularly difficult due to browser incompatibilities and uncertainties, often causing implementation u-turns and long delays. Brainy Data are however committed to invest in porting all their GUI components to this new platform while at the same time maintaining and improving existing software. During these busy times, your support and patience is greatly appreciated.	\N	\N	\N	mostynrs	2017-07-31 09:24:46	mostynrs	2017-07-31 09:25:14	0
