87	20	\N	The IoT Platforms - Security, Consolidation, Analytics. Tying it all together	A variety of IoT Platforms has evolved, with new approaches appearing constantly.  An overview of the range of platforms available for consolidation, analysis, AI? - with suggestions on how Omnis apps might make use of them.	The IoT may start with things, but the impact will be based on data, applications and microservices. Arrays of sensors offer one clear example — Homes, industrial data, patient data, power management - to name a few - will produce wide rivers of data. But how to handle it? How are insights being drawn from this data? What tools are being used to analyze, make decisions upon and deliver value from these datasets? Approaches include standard web protocol interfaces, APIs and add-on micro services. \r\rWe’ll take the high-level overview of a handful of these. These platforms offer sophisticated black box approaches to any number of larger engines in security, analytics, and AI. On the other hand, tools such as Omnis, PostgreSQL, Python, Node.js, Node-RED… constitute a toolbox for development of home-grown platforms. We’ll also take a look at a couple of ready-for-market products which have leveraged these technologies.\r\rWhat role might Omnis play in all this?	\N	\N	\N	mostynrs	2017-08-07 09:44:11	mostynrs	2017-08-07 09:44:11	0
88	20	\N	Writing a Desktop Application in a World of Web and Cloud Apps	Take part in a discussion about what customers expect (or will expect) from modern day applications.  This talk will take a holistic view of the application set against new technologies and the ways in which they present us with new challenges and new opportunities.	First it was the mobile phone, then it was the cloud, next it could be… almost anything.  Recent technologies are shifting the ground on top of which we build our applications and we need to able to respond more quickly so that we can continue the long tradition of users that love our Omnis apps.  To do so requires more than just adding a new interface or changing some features, it requires a shift in the way we approach software development and the way in which we think about our applications and our users.  But don’t be alarmed!  A small shift in perspective, combined with Studio 8 features and open source technologies, opens a whole new world of rapid development that can help you respond to users more quickly and more accurately.\r\rThis talk will focus on the life cycle of software development and ways to monitor, test, track and update applications, as well as revision management strategies for your source.  It will also contain a (slightly opinionated) discussion about how to structure an application in a way that allows you to deploy with more flexibility, while also improving testability.	\N	\N	\N	mostynrs	2017-08-15 10:16:36	mostynrs	2017-08-15 10:16:36	0
89	20	\N	ArtsMen and the API	Take a journey through the many iterations of API design that Arts Management Systems (Artsman) has gone through and benefit from the many lessons learned along the way while they designed a REST API that could drive real time charts.	In the summer of 2012 ArtsMan embarked upon a journey.  The journey was to to create a new kind of application,  one that took advantage of emerging web technologies while also taking users out of the office and releasing them into the wild open internet.  That journey centered around one critical piece: the REST API.  An API let’s an application communicate with the outside world in a standard way that many other applications can understand.  A REST API, commonly combined with JSON, is a loosely structured standard that has become a standard expectation for any modern web app.  Of course our journey started with research into Roy Fielding’s originating REST thesis, but from there it traveled down a long and winding road.  How do apps (and specifically Javascript apps) interact with the REST API?  How should they?  What does REST prescribe and how is that different from a SQL database?  How do developers discover what to do with the API?  How do you keep performance high?  How do you prevent a nefarious (or ignorant) user from crushing your servers?  How do you keep your data size down on the wire?  How do you expose your business logic?  How do you manage changes without breaking applications?  How do you deal with security?  How do applications know when data from your application has changed?  Why should you care about this if you only write desktop apps?\r\rThis talk will walk you through that journey with us so that you too can discover the magic behind Artsman's real-time dashboard (See Jon Harris’ talk for the sexy, visual part)\r\r(WARNING: Also contains a spattering of some really cool API-specific PostgreSQL tricks.)	\N	\N	\N	mostynrs	2017-08-15 10:18:04	mostynrs	2017-08-15 10:18:04	0
