103	20	\N	Automatic Generation of Data Objects	Use the query builder to automatically create table classes.	This session shows how the Query Builder can be used in order to generate data objects replacing the need of query classes. Those data objects will then make use of super class methods such as error handling etc. We will also find out how to use table classes without schemas or query classes. We are going to test those data objects in remote forms.	\N	\N	\N	mostynrs	2018-05-22 13:11:17	mostynrs	2018-06-12 19:45:55	0
108	20	\N	GitLab Continuous Integration (CI) for Omnis Studio	An abbreviated example showing how to run automated tests on commit, create a Docker container and then deploy that container into a staging environment. CI will help improve your code reliability, allow code review, and decrease the time from development to production.	Using Arts Management infrastructure as our example, we'll see how to use a virtualization environment (Proxmox) to host GitLab, CI workers, and HashiCorp Nomad to host the Docker staging environment.\r\rThe goal is to show one possible version of a modern tech stack and how each layer can help make a developers life a little easier. Setting up each layer is beyond the scope of this talk but using the layers is not.\r\rWe'll start with a working installation and walk through all the stages; from a feature request, to a commit, to code review, watching how CI works and then taking the CI artifact (a docker image) and deploying it into Nomad.	\N	\N	\N	mostynrs	2018-06-26 18:19:29	mostynrs	2018-06-26 18:19:29	0
102	20	\N	Working with WebSockets (Real-time Web)	New for Omnis Studio 8: Use WebSockets to transfer data to and, more importantly, from your server (unlike a SQL server or traditional HTTP server which only allows request/response).  Caching, signalling, and data lifetimes will be covered.	Ever wish that you could run your Omnis desktop app remotely without any additional software? Or maybe you just wish that you could figure out how to tell your Omnis application to clear out some cached data when something happens in your application server or your database.  Web sockets likely hold the key.  By providing a two-way connection over standard HTTP(S) they can allow you to build a modern desktop app for the web centred world.  \r\rThis talk will cover some of the strategies used by Arts Management Systems to load data over the WAN and keep it fast and up to date even on slow, unreliable network connections.  It will also cover some data entry concepts that can be facilitated by this new style of two way data communication, as well as performance enhancing cache clearing options.	\N	\N	\N	mostynrs	2018-05-18 13:33:54	mostynrs	2018-06-28 06:23:03	0
110	20	\N	Topic 2 TBA	\N	\N	\N	\N	\N	mostynrs	2018-07-03 14:12:03	mostynrs	2018-07-03 14:12:03	0
111	20	\N	The Studio 9 Text Editor	There is a completely new way to enter code in Studio 9 - you better find out about it !	Studio 9 introduces a completely new way to enter code - it is effectively a regular text editor now.  This means changes in the parser, old commands no longer supported and numerous other experience changes.  \r\rThis is going to affect us all!	\N	\N	\N	mostynrs	2018-07-05 15:39:48	mostynrs	2018-07-05 15:39:48	0
91	20	\N	Intro to React JS and Marquee Charts 2018	An introduction to Facebook’s React JavaScript library and Marquee charting library with new features and examples since 2017.	Facebook’s React JavaScript library has revolutionized the development of user interfaces for the web. This talk will provide an introduction to the key concepts behind React and guide participants through some straight forward examples of building and deploying web applications using React. Building on this foundation, the sample web application will be enhanced to show a variety of data visualization examples made possible by the Marquee charting library’s React components.	\N	\N	\N	mostynrs	2017-08-18 18:19:05	mostynrs	2018-08-09 16:03:08	0
112	20	\N	Deploying Charts Using Omnis Studio 8	How to get Omnis to display Marquee Charts that reflect data stored inside Omnis.	Since last year, we’ve put some work into packaging up Marquee and React for use within Omnis, and attending this talk should give interested parties all the knowledge they need to get Marquee charts up and running quickly within Omnis.\r\rStudio 8 is a major milestone for Omnis and with it comes more enhancements that let Omnis connect with the rest of the software world. One such area is the OBrowser component which opens up all kinds of possibilities for web based integrations including data visualization. A simple Omnis Marquee charting example will be demonstrated, along with the new omnis-marquee library.	\N	\N	\N	mostynrs	2018-08-09 16:05:58	mostynrs	2018-08-09 16:05:58	0
113	20	\N	myEcoCost	Introducing Ecological Accounting into every business.	The sustainability challenge could be addressed effectively when all economic activity is squared the planetary boundaries.  The myEcoCost shows how this can be achieved.\r\rIf your clients have an interest in green supply chains, substantiating green product claims or simply want to pull their weight in addressing climate change, this session should be of interest to you.\r\rThe software is entering business trial stage.	\N	\N	\N	mostynrs	2018-08-29 13:44:11	mostynrs	2018-08-29 13:47:11	0
99	20	\N	Leadership and Business Workshop	What was leadership and what has it become?  How is this impacting on the modern business?	In summary, my 26 years in business have been all about innovation, business process and seeing beyond what is in the immediate future, both for my clients and for our business.  I’ve taken clients from manual systems and processes through to having a completely integrated business process.  I’ve developed pricing and measurement methods along the way that bring you to the heart of why your business isn’t preforming as well as it should.  \r\rI love talking about business and working out how to get the best from a business.\r\rMy two sessions are:\r\rInnovation - why you need to innovate, what processes to follow, how to remain relevant with your clients and maintain your success.\r\rThe impact of innovation - how has innovation extended what we do in our product, what else has it offered our clients, why are we more relevant? How do you price a job, how do you join the dots between the spec from the client, planning/executing on the job, measuring what you have done, changing direction, communicating expectations, and staying on top of it all.  We will canvas in the areas of Job planning, pricing and capacity planning.  How these impact on service businesses and the tools that are available to manage the business.	\N	\N	\N	mostynrs	2018-05-10 07:14:31	mostynrs	2018-09-25 09:46:31	0
109	20	\N	The IoT Tour Continues - Omnis connects to the Watson IoT!\r	Why should kids have all the fun? The Internet of Things is about more than robots and drones… We move into integrating IoT hardware/device/systems with various software, including Omnis.\r	The Tour continues… The Internet of Things continues to explode. And, while the ‘things’ are fun, major vendors are making big bets on platforms to speed development, facilitate deployment and manage the security chain. The projections? $300B annually by 2020.\r\rThe ‘Hot Topic’ in the IoT is gateways, and their security. We’ll start with the broad overview, demo a handful of devices, including potential for using several communication protocols - like MQTT, REST interfaces - and explore techniques for using them interfacing with Murano and IBM’s Watson IoT Platform. Shouldn’t Omnis fit into this mix?\r\rWe’ll again do a quick overview of a handful of the common devices and platforms, and move quickly to some of the more sophisticated hardware testbed devices, designed to jumpstart development efforts in Wifi, 15.4 radio - think: Smart Cities - and Bluetooth Low Energy, among others.\r\rWith the popularity of platforms like Arduino, Raspberry Pi, Edison and many others within the ‘Maker Movement’, programming of these embedded systems has become downright simple. We’ll quickly review some of the debugging capabilities with these environments. Gone are the days of EE-only designs. All these ‘things’ need back end applications, databases and secured - often mobile - front ends. Omnis?\r\rWarning: This session will be hands-on; we may even get to play with some IoT toys in this session. Expect flashing lights, some gizmos and even a little programming.\r	\N	\N	\N	mostynrs	2018-07-03 14:11:54	mostynrs	2018-10-05 11:23:14	0
