174	SHUTTLE	INFO_11	Shuttle info for $euromnis.2016	\N	1	Rome to Siena\rThere’s a bus that runs from Rome to Siena, operated by SENA. Buses leave Rome’s Tiburtina bus station every 2.5 hours or so. A one-way adult ticket is €22.\rThe quickest train from Rome to Siena is the high-speed AV train – the Frecciarossa – that makes the trip in about 2 hours and 40 minutes, with one train change at Chiusi. There’s a Frecciabianca (another AV train) that makes the trip in just over 3 hours with change at Grosseto.\r\rThere will be 2 shuttle pickups from Pisa airport and 3 from Florence airport on Sunday 16th Oct, depending on the mix of delegate preferences. Timing of shuttle to be advised.\r\rPublic transport from Pisa to Siena:\rtake the train which involves a change at Empoli. No regular buses.  You'll have to get from the airport to the main bus station first, by bus or train. There is a SINGLE bus service from Pisa airport to Siena at 11:45 am each day.\r\rPublic transport from Florence to Siena:\rBoth buses and trains.  The bus is a faster service though.  You'll have to get from the airport to the main bus station first, by bus!	\N	\N	\N	\N	\N	\N	\N	\N	20	2016-08-02 12:28:16	mostynrs	2016-08-02 13:24:48	mostynrs	3	1	20:SHUTTLE:INFO_11:
