127	EMAIL_TRAVEL	MESSAGE	in character field	0	1	Dear [[irCurrentRecord.PSN_FIRST_NAME]],\r\rWe have a different arrangement for this year's conference regarding travel and connections.  The main difference is that there is a train station (Horrem) only 750m from the venue so WE WON'T BE PROVIDING A SHUTTLE SERVICE.  \r\rAt Cologne there are 2 train stations where the ICE can arrive:\rCologne Mainstation (Hauptbahnhof)\rCologne Messe/Deutz Station\rEach is less than 3 km away from the other, just on the other side of the Rhine.\r \rFrom the main Train Station, you need to take the local train to Kerpen-Horrem:\rS13 direction Sindorf/Düren\rS19 direction Sindorf/Düren\r \rIt will take approximately 20 Minutes\r \rThe road from Horrem to the venue is sealed all the way so its easy to walk.  If you have particularly heavy bags you can get a taxi for about €5.\r\rIf you are arriving at Dusseldorf (40-50 mins) or Köln-Bonn (15 mins) airports, there is a train from each to Köln Hbf where you can change to the local service.\r\rAll that said, it is still important for us to get your travel plans, *particularly* if you are going to arrive at the venue before 18:00.\r\rPlease copy and paste the link below into your browser to provide us with your travel details to the conference.\r\r[[icTravelLink]]\r\rAnd be sure to include any dietary requirements!\r\rRegards,\rThe Organising Committee	0	0	\N	\\x	00:00:00	\N	\N	\N	20	2016-07-11 16:25:48	x	2018-09-26 13:13:31	mostynrs	7	1	20:EMAIL_TRAVEL:MESSAGE:
