237	WELCOME_DG_1OF2	P20	see CHAR column	\N	1	One important announcement to make now is that Mike Matthews and Rob Mostyn will be taking a break from organising a conference in 2019.  Mike is decreasing his workload and the ensuing stresses and Rob is kicking off a major business proposition (come to his commercial session on Monday night).  We are making this announcement now so that you can discuss amongst yourselves what should happen next year.  One of the promises Jean Marc made several years ago was that we would establish a conference infrastructure that provided a legacy for others to take advantage of in the future.  We believe we have provided such a structure with the availability of the CONFERENCE application that supports the administration of each conference (you will see a little of this on Tuesday night).\r	\N	\N	\N	\N	\N	\N	\N	\N	20	2018-10-05 13:32:12	mostynrs	2018-10-05 17:36:33	mostynrs	1	0	20:WELCOME_DG_1OF2:P20:
