-- Name: check_dil_primary(); Type: FUNCTION; Schema: conf; Owner: _developer
--

CREATE FUNCTION conf.check_dil_primary() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
/**********************************************************************************************
Purpose:    to ensure only one DIL record for a given DIL_FOH_REF can have a DIL_PRAMARY = 1
Created:    2017-07-06 Graham Stevens
Revisions:  

**********************************************************************************************/
DECLARE
    vDelegate text;
BEGIN
    select psn_first_name || ' ' || psn_surname into vDelegate
    from conf.delegateinvoicelinks
    join conf.delegates on dg_seq = dil_dg_ref
    join conf.person on psn_seq = dg_psn_ref
    where dil_foh_ref = NEW.dil_foh_ref and dil_dg_ref <> NEW.dil_dg_ref and dil_primary = 1;

    if vDelegate is not null then
        RAISE EXCEPTION '% is already set as the primary delegate', vDelegate; 
    end if;
    
	RETURN NEW;
END;
$$;


ALTER FUNCTION conf.check_dil_primary() OWNER TO _developer;

--
-- Name: invoice_sent(); Type: FUNCTION; Schema: conf; Owner: _developer
--

CREATE FUNCTION conf.invoice_sent() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
/**********************************************************************************************
Purpose:    to update all linked delegates when one  of them has the dg_email_invoice_sent entered
Created:    2017-07-06 Graham Stevens
Revisions:  

**********************************************************************************************/
DECLARE
    vPrimary    conf.delegateinvoicelinks.dil_primary%TYPE;
    vInvoice    conf.delegateinvoicelinks.dil_foh_ref%TYPE;
BEGIN
    select dil_primary, dil_foh_ref into vPrimary, vInvoice
    from conf.delegateinvoicelinks
    where dil_dg_ref = NEW.dg_seq;

    -- this will stop the trigger from looping when the other updates occur
    if vPrimary > 0 then 
        -- update all other delegates
        update conf.delegates
        set dg_email_invoice_sent = NEW.dg_email_invoice_sent
        where dg_seq in (select dil_dg_ref
                         from conf.delegateinvoicelinks
                         where dil_foh_ref = vInvoice
                         and dil_dg_ref <> NEW.dg_seq); 
    end if;
    
	RETURN NEW;
END;
$$;


ALTER FUNCTION conf.invoice_sent() OWNER TO _developer;

