--

CREATE FUNCTION public.checkproductsource(pprodcode text, pstartchar smallint, pstringlength smallint, plabel text) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
BEGIN

    if substr(pProdcode, pstartchar, pstringlength) = plabel then
        return true;
    else
        return false;
    end if;
END;
$$;


